import { FETCH_PROJECTS, FETCH_PROJECTS_FAIL } from "../actions/types";

const initialState = { fetched:false, projects: [] };

export default function (state = initialState, action) {
  const { type, payload } = action;

  switch (type) {
    case FETCH_PROJECTS:
      return {
        ...state,
        fetched:true,
        projects: payload.projects,
      };
    case FETCH_PROJECTS_FAIL:
      return {
        ...state,
        fetched:false,
        projects: [],
      };
    default:
      return state;
  }
}
